		function showNextBtn() {
			
			//  הוספת כפתור מעבר לשאלה הבאה במידה ולא הגענו לשאלה האחרונה במשחק
			if (numOfQuestions == counterQuestions) {
				endGame();
			} else {
		
				if (!bIsGameStop) {
					var nextElement = new lib.next();
					nextElement.name = "nextBtn";
					nextElement.x = 600;
					nextElement.y = 370;
					nextElement.addEventListener("click", clearQuest);
					stage.addChild(nextElement);
					//stage.removeChild(stage.getChildByName("check_btn"));
		
					if (((counterQuestions % (Math.floor(numOfQuestions / 3))) == 0) && (counterFbMessage != Math.floor(counterQuestions / (Math.floor(numOfQuestions / 3)))))
					{
						var currentFb = Math.floor(counterQuestions / (Math.floor(numOfQuestions / 3)));
		
						if (!bIsGameMuted) {
							audio = new Audio("sounds/FB" + currentFb + ".mp3");
							audio.play();
		
						}
		
						self.bg_mc.scientist_mc.gotoAndPlay(3);
						counterFbMessage++;
						var fbMessage = new(arrFBMessages[(currentFb - 1)])();
						fbMessage.name = "currentFBmessage";
						fbMessage.x = 1200;
						fbMessage.y = 260;
						stage.addChild(fbMessage);
					
						isFbMessageExist = true;
					}
				}
			}
		}
		
